import React, { useState } from "react";
import NewExpense from "./NewExpense"; // Make sure to import NewExpense if it's in a separate file
import Expenses from "./Expenses"; // Make sure to import Expenses if it's in a separate file

const App = () => {
  const [expenses, setExpenses] = useState(DUMMY_EXPENSES);

  const addExpenseHandler = (expense) => {
    setExpenses((prevExpenses) => {
      return [expense, ...prevExpenses];
    });
  };

  return (
    <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
      {/* Add your image here */}
      <img
        src="path/to/logoseaherbs.png"
        alt="Logo Sea Herbs"
        style={{ width: "100px", height: "100px" }} // Adjust width and height as needed
      />

      <NewExpense onAddExpense={addExpenseHandler} />

      <Expenses items={expenses} />
    </div>
  );
};

export default App;
